%spark

def decade(date: String): Integer = {
    var decade = 1900
    if (date != null && !date.trim.isEmpty) {
        val year = date.trim.takeRight(4).toInt
        decade = (10*Math.floor(year/10)).toInt
    }        
    decade
}
sqlContext.udf.register("decade", decade(_:String))

def duration(timeString: String): Integer = {
    var minutes = 0;
    if( timeString != null && !timeString.isEmpty ) {
        val time =  timeString.split( ":" )
        minutes = time(0).toInt * 60 + time(1).toInt
    }
    minutes
}
sqlContext.udf.register("duration", duration(_:String))
